import { Styles } from "./Styles";

export function FormSocialLogin(props){
    return(
        <View style = {props.style}>
            <View style = {[Styles.socialLogin, {backgroundColor: "#ffffff"}, {alignItems: 'center'}]}>
                <View style = {[Styles.socialLogin, {backgroundColor: "#008EF1"}, {alignItems: 'center'}, {marginLeft: 170}]}>                   
                </View>
            </View>
        </View>
    );
}
